import { Input } from 'antd';
import icon from "../assets/logo.png"
const { Search } = Input;

const onSearch = (value) => console.log(value);

const SearchPage = () => (
    <div className={"main-body"}>
        <div className={"search-body"}>
            <div className={"logo"}>
                <img src={icon} alt=""/>
            </div>
            <Search
                placeholder="input search text"
                onSearch={onSearch}
                style={{
                    width: 200,
                }}
            />
        </div>

    </div>
);
export default SearchPage;
